import React from 'react';
import { Container, Row, Col, Image, Button} from 'react-bootstrap';

import { statusStorage } from '../Storage/Storage.js';

const Header = () => {
  const [status, setStatus] = statusStorage();

  return(
    <Container>
      <Row>
        <Col xs={2}>
          <Image src={status.currentUser.image} style={{"height":"50px", "width":"50px"}} roundedCircle />
        </Col>
        <Col xs={8}>
          <Row>
            <b>{status.currentUser.name}</b>
          </Row>
          <Row>
            {status.currentUser.comment}
          </Row>
        </Col>
        <Col xs={2}>
          <Button className="float-right" variant="link">...</Button>
        </Col>
      </Row>
    </Container>
  );
}

export default Header;
